function loadAssignments(){var table=document.querySelector("tbody"),template=document.querySelector("#assignmentRow"),content=template.content,cells=content.querySelectorAll("td");DataService.getUsersAssignments(AuthService.getUser()._key).success(function(data){for(var i=0;i<data.length;i++){var assignment=data[i];cells[0].querySelector(".paper").textContent=assignment._id,cells[1].querySelector(".completion").style.width=assignment.completion+"%",cells[1].querySelector(".completion").textContent=assignment.completion+"%",cells[2].querySelector("button").dataset.assignmentKey=assignment._key;var clone=content.cloneNode(!0);table.appendChild(clone)}})}function loadAssignment(element){localStorage.assignmentKey=element.dataset.assignmentKey,alert("Set localStorage.assignmentKey to "+localStorage.assignmentKey),window.location="paper-coder.html"}$(document).ready(function($){Site.run(),loadAssignments()});